/*Table structure for table `device_info` */

DROP TABLE IF EXISTS `device_info`;

CREATE TABLE `device_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '设备id',
  `device_sn` varchar(64) DEFAULT NULL COMMENT '设备编号',
  `manufacturer_id` int(11) DEFAULT NULL COMMENT '设备厂家',
  `model` varchar(64) DEFAULT NULL COMMENT '设备型号',
  `name` varchar(64) DEFAULT NULL COMMENT '设备品名',
  `generation_date` datetime DEFAULT NULL COMMENT '生产日期',
  `equipment_life` float DEFAULT NULL COMMENT '使用年限',
  `devce_type_id` int(11) DEFAULT NULL COMMENT '设备类型',
  `power_supply_mode` int(11) DEFAULT NULL COMMENT '供电方式',
  `is_iot_device` int(11) DEFAULT NULL COMMENT '是否物联网设备',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '备注信息',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '0在线1离线',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `device_sn` (`device_sn`)
) ENGINE=InnoDB AUTO_INCREMENT=264 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='设备信息';

