/*Table structure for table `device_install_info` */

DROP TABLE IF EXISTS `device_install_info`;

CREATE TABLE `device_install_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `device_id` int(11) DEFAULT NULL COMMENT '设备ID',
  `device_sn` varchar(32) DEFAULT NULL COMMENT '设备编码',
  `install_date` date DEFAULT NULL COMMENT '安装日期',
  `latitude` decimal(16,12) DEFAULT NULL COMMENT '纬度',
  `longitude` decimal(16,12) DEFAULT NULL COMMENT '经度',
  `install_address` varchar(100) DEFAULT NULL COMMENT '安装地址',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `pic_url` varchar(500) DEFAULT NULL COMMENT '图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=80 DEFAULT CHARSET=utf8mb4 COMMENT='设备安装信息';

