/*Table structure for table `device_metric` */

DROP TABLE IF EXISTS `device_metric`;

CREATE TABLE `device_metric` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `equipment_type` varchar(256) NOT NULL COMMENT '设备类型',
  `type_id` int(11) DEFAULT NULL COMMENT '设备类型id(与device_type的 type相对应)',
  `description` varchar(512) DEFAULT NULL COMMENT '设备类型说明',
  `metric` varchar(256) NOT NULL DEFAULT 'mete.flow' COMMENT '度量标准',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4;

